> Top News McCarthy expresses regret for Benghazi comments FILE - In this Sept. 30, 2015 file photo, House Majority Leader Kevin McCarthy of Calif., left, walks on Capitol Hill in Washington. McCarthy says he regrets comments suggesting the House special committee on Benghazi has political goals. McCarthy says he never intended to make that suggestion. He says the purpose of the committee is to find out the truth and it has nothing to do with politics. (AP Photo/Andrew Harnik, File) 
